var palindrome=function(e){var n,l;return e.length%2==1?(n=e.slice(0,Math.floor(e.length/2)),l=e.slice(Math.ceil(e.length/2),e.length)):(n=e.slice(0,e.length/2),l=e.slice(e.length/2,e.length)),l=l.split("").reverse().join(""),n==l},dashInsert=function(e){e=e.toString();for(var n=[],l=0,t=0;t<e.length;t++)t==e.length-1?n.push(e.slice([t-l],[t+1])):e[t]%2==1&&e[t+1]%2==1?(n.push(e.slice([t-l],[t+1])),l=0):l++;return n.join("-")};